      SELECT DISTINCT - COUNT ( * ) * - 90 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q5039.out
    data: |
      810
